import './Rodape.css'
import { BsFacebook } from "react-icons/bs";
import { FiTwitter } from "react-icons/fi";
import { FaInstagram } from "react-icons/fa";
import { CiLinkedin } from "react-icons/ci";


function Rodape() {
    return (
        <footer>
            <ul>
                <li><FaInstagram /></li>
                <li><FiTwitter /></li>
                <li><FaInstagram /></li>
                <li><CiLinkedin /></li>
            </ul>
        </footer>
    )
}

export default Rodape
